In[338]:= (* HERE'S ANOTHER ATTEMPT AT A FINAL EXAMPLE *)
    Clear[{g1,g2}];

r = {g1,g2}.M - 1200*Log2[{2,3,5}];
L = DiagonalMatrix[Log2[{2,3,5}]];

damage[i_] := Abs[r.i] *Total[Abs[L.i]];

Plot3D[
  {
    (* here's 15/8 and 18/5 creating the tie strip above the world *)
    (*Max[*)
    damage[{-3,1,1}],
    damage[{1,2,-1}],
    
    (*3/2,5/2,5/3,8/3,9/5,16/5, just being below for noise, and being a semi-believable arbitrary target-interval set *)
    damage[{-1,1,0}],
    damage[{-1,0,1}],
    damage[{0,-1,1}],
    damage[{3,-1,0}],
    damage[{0,2,-1}],
    damage[{4,0,-1}]
    (*]*)
  },
  {g1,397,407},
  {g2, 1890,1925},
  PlotRange -> {0,150},
  (*ClippingStyle -> None,*)
  MaxRecursion -> 2,
  ImageSize -> 1000
]

