In[343]:= Unprotect[D];
j = 1200*Log2[{2,3,5}];
D = {{1.056,2.112}}; (* that's -4x the change for g3 as for g2, so techincally it could be {{0,1,-4}}, but then the scale on the diagram wouldn't be quite right, i.e. from 0 to 1 the b1 value *)
b = {b1};
gZero = {399.809, 1901.289};(*{600,1899.04,2774.66};*)
tZero = gZero.M;
negativeRZero = j - tZero;

damage[i_] := Abs[(b.D.M-negativeRZero).i]*Total[Abs[L.i]];

Plot[
  {
    (* here's 15/8 and 18/5 creating the tie strip above the world *)
    (*Max[*)
    damage[{-3,1,1}],
    damage[{1,2,-1}],
    
    (*3/2,5/2,5/3,8/3,9/5,16/5, just being below for noise, and being a semi-believable arbitrary target-interval set *)
    damage[{-1,1,0}],
    damage[{-1,0,1}],
    damage[{0,-1,1}],
    damage[{3,-1,0}],
    damage[{0,2,-1}],
    damage[{4,0,-1}]
    (*]*)
  },
  {b1, -0.25,1.25},
  PlotRange -> {0,150},
  PlotLabels -> "Expressions",
  ImageSize -> 1000
]

